import React, { Component } from 'react';
import { Box, Text } from "@chakra-ui/core";

import './CourseCard.css'

const CourseCard = ({code, section, name, coordinator, instructor, formCompleted}) => {
    return(
        <Box className="card">
            <Text fontWeight="bold" textTransform="uppercase">{code}.00{section}</Text>
            <Text>{name}</Text>
            <Text>Instructor: {instructor.firstName} {instructor.lastName}</Text>
            <Text>Coordinator: {coordinator.firstName} {coordinator.lastName}</Text>
        </Box>
    )
}

export default CourseCard;
